import React from 'react';
import logo from "./images/logo.jpeg"


function Header(){
  var heading = "DESK SKILL";
  return(
    <React.Fragment>
      <img src={logo}/>
      <h1 style={{textAlign: "center"}}>{heading}</h1>
    </React.Fragment>
  )
}

export default Header
